import PropTypes from 'prop-types';
import Modal from '../../../shared/Modal/Modal';

const ConfigurationStatusChangeModal = props => {
    const { isVisible, showModal, hideModal, onClose } = props;

    return (
        <Modal
            isVisible={isVisible}
            showModal={showModal}
            hideModal={hideModal}
            onClose={onClose}
            title={'Confirm activation/deactivation'}
            showFooter
            showClose
        >
            <div> Are you sure to active/deactivate this configuration?</div>
        </Modal>
    );
};

ConfigurationStatusChangeModal.propTypes = {};

export default ConfigurationStatusChangeModal;
